npm install opossum const circuitBreaker = require('opossum');
const fetch = require('node-fetch'); async function callPaymentService(orderId) { const res = await fetch(`http://localhost:4000/process/${orderId}`); if (!res.ok) throw new Error('Payment failed'); return res.json();
} const options = { timeout: 3000, errorThresholdPercentage: 50, resetTimeout: 10000
}; const breaker = new circuitBreaker(callPaymentService, options); // Fallback
breaker.fallback(() => ({ status: 'failed', reason: 'Service down. Try later.' })); // Events
breaker.on('open', () => console.log('🔴 Circuit opened'));
breaker.on('halfOpen', () => console.log('🔧 Testing recovery'));
breaker.on('close', () => console.log('✅ Circuit closed')); // Use it
app.post('/order', async (req, res) => { try { const result = await breaker.fire(req.body.orderId); res.json({ status: 'success', data: result }); } catch (err) { res.status(503).json({ error: err.message }); }
});

